import React from "react";
import {
  Modal,
  ModalHeader,
  ModalBody,
  CardBody,
  Button,
  ModalFooter,
} from "reactstrap";

import SimpleBar from "simplebar-react";
import IContact from "../alias/IContact";
import SelectContact from "./SelectContact";

interface IProps {
  show: boolean;
  setShow(value: boolean): void;
}

const ModalForwardMessageTo: React.FC<IProps> = ({ show, setShow }) => {
  const toggle = () => setShow(!show);

  return (
    <Modal backdrop="static" isOpen={show} centered toggle={toggle}>
      <ModalHeader toggle={toggle}>Forward to...</ModalHeader>
      <ModalBody>
        <CardBody className="p-2">
          <SimpleBar style={{ maxHeight: "200px" }}>
            <SelectContact
              handleCheckContact={(teste: boolean, value: IContact) => {}}
            />
          </SimpleBar>
          <ModalFooter className="border-0">
            <Button color="primary">Forward</Button>
          </ModalFooter>
        </CardBody>
      </ModalBody>
    </Modal>
  );
};

export default ModalForwardMessageTo;
